let widget = new ListWidget();
widget.backgroundColor = Color.grey;

const flowerImages = ["", "", "", "", ""];

let randomIndex = Math.floor(Math.random() * flowerImages.length);

let imageData = Data.fromBase64String(flowerImages[randomIndex]);
let image = Image.fromData(imageData);

widget.backgroundImage = image;

function randomBetween(a, b) {
    return Math.floor(Math.random() * (b - a + 1)) + a;
}
const randomSuicide = randomBetween(1750, 2200);
const now = new Date();
const hours = now.getHours();
const widgetType = "small"; //config.widgetFamily;
if(widgetType === "small") {
  let text = widget.addText("Around " + randomSuicide + " people took their lives in the last 24 hours.");
  text.textColor = new Color("#000000");
  text.font = Font.boldSystemFont(14.5);
  widget.addSpacer();
  let textTwo = widget.addText("And you're not one of them❤️");
  textTwo.textColor = new Color("#FFFFFF");
  textTwo.font = Font.boldSystemFont(16.5);
}
widget.presentSmall();

Script.setWidget(widget);
Script.complete();